column8:
Jabra ROX Wirelessは、携帯電話にペアリングして音楽を楽しむワイヤレスイヤホンです。音楽だけでなくストリーミングメディアに対応、マイクつきなのでハンズフリー通話もできるステレオヘッドセットです。<br>
イヤーパッド部分がマグネットになっているので、ネックレスのように本体を首にかけて持ち運ぶことができます。マグネットのイヤーパッド部分は電源コントロールも兼ねており、くっつければ電源のオフ、離せば電源オンです。<br>
防塵・防滴設計で屋外でも使え、音楽を聴きながらの軽い運動時にもぴったりの製品です。<br>
Jabra ROX Wirelessは、ワイヤレスでも臨場感あふれるサウンドを提供します。<br>
スピーカーの仕様 : 6 mm ダイナミックスピーカー / 92 dB at 1 mW 1 kHz / 16 Ohm / 20Hz - 20kHz。<br>
Bluetooth ver.4.0対応で、携帯電話2台と同時に接続および待ち受け可能。音楽再生・連続通話時間は最大5.5時間で、最大待ち受け時間は8日間です。<br>
音量調整ボタン、多機能ボタンで通話と音楽を簡単に操作。日本語の音声ガイダンスによりペアリング状況やバッテリー残量等が知らされるので、さらに使い勝手がよいです。<br>
内容物は、JABRA ROX WHIRELESS本体1台、USBケーブル1本、イヤージェル4サイズ（1つは本体に装着済み）、イヤーウイング 3サイズ、ケーブルクリップ 1個、保護ポーチ1個、クイックスタートガイド1冊、保証書。<style>

